import React from "react";

export const Footer = () => {
    return (
        <footer className="container ">
            <div className="row row-cols-auto align-items-center">
                <div className="col author">Amal Janabayev</div>
                <div className="col author">Jasur Amirov</div>
                <div className="col author">Jenny Detmering</div>
                <div className="col author">Greg Harris</div>
                <div className="col author">Hanh Le</div>
                <div className="col author">Faiz Azeem</div>
            </div>
        </footer>
    )
}

export default Footer
